import React from "react";

const Dashboard = () => {
  return (
    <div className="p-4 h-screen">
      <div className="text-white text-5xl font-bold mb-4">
        <h1>Home</h1>
      </div>
      <div className="grid grid-cols-2 gap-4 h-full">
        <div className="bg-blue-500 p-8 text-white col-span-2">
          Div 1 (Wider)
        </div>
        <div className="bg-green-500 p-8 text-white col-span-1">
          Div 2 (Smaller)
        </div>
        <div className="bg-red-500 p-8 text-white col-span-1">
          Div 3
        </div>
        <div className="bg-yellow-500 p-8 text-white col-span-1">
          Div 4
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
